public synchronized void setAMInfos(List<AMInfo> amInfos) {
  maybeInitBuilder();
  if (amInfos == null) {
    this.builder.clearAmInfos();
    this.amInfos = null;
    return;
  }
  initAMInfos();
  this.amInfos.clear();
  this.amInfos.addAll(amInfos);
}
